import React from 'react';
import './Display.css';


const Display = () => {
	return (
			<div className="w-100 pt4 mt4 display"
			style={{display:'flex', justifyContent: 'flex-start'}}>
				<p className="f2">123456789</p>
			</div>
		)
}

export default Display;
